using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace xManik.Extensions
{
    public static class Utils
    {
        public static readonly string DefaultUserProfileImage = "data:image/png;base64,";
        public static readonly string Base64DefaultProfileImage = "";
        public static byte[] imageBytes = Convert.FromBase64String(Base64DefaultProfileImage);


        public static string ConvertByteToString(byte[] array)
        {
            var base64 = Convert.ToBase64String(array);
            return String.Format("data:image/jpeg;base64,{0}", base64);
        }
    }
}
